import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home/Home';
import Stories from './components/Stories/Stories';
import Electronic from './pages/Electronic/Electronic';
import TechoInfo from './pages/TechoInfo/TechoInfo';
import Fashion from './pages/Fashoin/Fashion';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/electronic" element={<Electronic />} />
        <Route path="/fashion" element={<Fashion />} />
        <Route path="/techinfo" element={<TechoInfo />} />
       <Route path="/story/:id" element={<Stories />} />
      </Routes>
      </Router>
  );
}

export default App;
